import React from 'react'
import { Navigate, Outlet } from 'react-router'

const ProtectedRoute = () => {
    let auth = {'token' :true}
    return(
        auth.token ? <Outlet/> : <Navigate to='/login'/>
    )
}

export default ProtectedRoute;
